import React from "react";
import "./navbar.css";
import logo from "../../assets/logosvg.svg";

function Navbar() {
  return (
    <div className="nav">
      <div className="logo">
        <img src={logo} alt="" srcset="" />
        abcd
      </div>
      <div className="profie-icon"></div>
    </div>
  );
}

export default Navbar;
